import{e as s,o as a,s as t}from"./vendor.6d1adbea.js";const n={class:"markdown-body"},l=[t('<h1>Button 按钮</h1><h3>介绍</h3><p>按钮。</p><h2>代码演示</h2><h3>按钮类型</h3><p>按钮支持 <code>default</code>、<code>primary</code>、<code>info</code>、<code>warning</code>、<code>danger</code>、<code>success</code> 六种类型，默认为 <code>default</code>。</p><pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">cs-button</span> <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;primary&quot;</span>&gt;</span>主要按钮<span class="hljs-tag">&lt;/<span class="hljs-name">cs-button</span>&gt;</span>\n<span class="hljs-tag">&lt;<span class="hljs-name">cs-button</span> <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;info&quot;</span>&gt;</span>信息按钮<span class="hljs-tag">&lt;/<span class="hljs-name">cs-button</span>&gt;</span>\n<span class="hljs-tag">&lt;<span class="hljs-name">cs-button</span> <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;danger&quot;</span>&gt;</span>危险按钮<span class="hljs-tag">&lt;/<span class="hljs-name">cs-button</span>&gt;</span>\n<span class="hljs-tag">&lt;<span class="hljs-name">cs-button</span> <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;default&quot;</span>&gt;</span>默认按钮<span class="hljs-tag">&lt;/<span class="hljs-name">cs-button</span>&gt;</span>\n<span class="hljs-tag">&lt;<span class="hljs-name">cs-button</span> <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;warning&quot;</span>&gt;</span>警告按钮<span class="hljs-tag">&lt;/<span class="hljs-name">cs-button</span>&gt;</span>\n</code></pre><h3>块级 block</h3><p>通过 <code>block</code> 属性来设置块级样式。</p><pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">cs-button</span> <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;primary&quot;</span> <span class="hljs-attr">block</span>&gt;</span>块极元素<span class="hljs-tag">&lt;/<span class="hljs-name">cs-button</span>&gt;</span>\n<span class="hljs-tag">&lt;<span class="hljs-name">cs-button</span> <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;info&quot;</span> <span class="hljs-attr">block</span>&gt;</span>块极元素<span class="hljs-tag">&lt;/<span class="hljs-name">cs-button</span>&gt;</span>\n</code></pre><h3>禁用状态</h3><p>通过 <code>disabled</code> 属性来禁用按钮，禁用状态下按钮不可点击。</p><pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">cs-button</span> <span class="hljs-attr">disabled</span> <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;primary&quot;</span>&gt;</span>disabled<span class="hljs-tag">&lt;/<span class="hljs-name">cs-button</span>&gt;</span>\n<span class="hljs-tag">&lt;<span class="hljs-name">cs-button</span> <span class="hljs-attr">disabled</span> <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;info&quot;</span>&gt;</span>disabled<span class="hljs-tag">&lt;/<span class="hljs-name">cs-button</span>&gt;</span>\n</code></pre><h3>加载状态</h3><p>通过 <code>loading</code> 属性设置加载状态。</p><pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">cs-button</span> <span class="hljs-attr">loading</span> <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;info&quot;</span>&gt;</span><span class="hljs-tag">&lt;/<span class="hljs-name">cs-button</span>&gt;</span>\n<span class="hljs-tag">&lt;<span class="hljs-name">cs-button</span> <span class="hljs-attr">loading</span> <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;warning&quot;</span>&gt;</span>加载中...<span class="hljs-tag">&lt;/<span class="hljs-name">cs-button</span>&gt;</span>\n</code></pre><h3>图标按钮</h3><p>通过 <code>icon</code> 属性设置图标。</p><pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">cs-button</span> <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;primary&quot;</span> <span class="hljs-attr">icon</span>=<span class="hljs-string">&quot;like&quot;</span>&gt;</span>喜欢<span class="hljs-tag">&lt;/<span class="hljs-name">cs-button</span>&gt;</span>\n<span class="hljs-tag">&lt;<span class="hljs-name">cs-button</span> <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;info&quot;</span> <span class="hljs-attr">icon</span>=<span class="hljs-string">&quot;user&quot;</span>&gt;</span>张三<span class="hljs-tag">&lt;/<span class="hljs-name">cs-button</span>&gt;</span>\n</code></pre><h3>自定义颜色</h3><p>通过 <code>color</code> 属性可以自定义按钮的颜色。</p><pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">cs-button</span> <span class="hljs-attr">style</span>=<span class="hljs-string">&quot;color: #fff&quot;</span> <span class="hljs-attr">color</span>=<span class="hljs-string">&quot;#7232dd&quot;</span>&gt;</span>单色按钮<span class="hljs-tag">&lt;/<span class="hljs-name">cs-button</span>&gt;</span>\n<span class="hljs-tag">&lt;<span class="hljs-name">cs-button</span> <span class="hljs-attr">style</span>=<span class="hljs-string">&quot;color: #fff&quot;</span> <span class="hljs-attr">color</span>=<span class="hljs-string">&quot;linear-gradient(135deg,#fa2c19 0%,#fa6419 100%);&quot;</span>&gt;</span>\n  渐变色按钮\n<span class="hljs-tag">&lt;/<span class="hljs-name">cs-button</span>&gt;</span>\n</code></pre><h3>跳转 href</h3><p>通过 <code>href</code> 属性来设置需要跳转的链接，当作 <code>a</code> 标签使用。</p><pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">cs-button</span> <span class="hljs-attr">href</span>=<span class="hljs-string">&quot;https://baidu.com&quot;</span> <span class="hljs-attr">type</span>=<span class="hljs-string">&quot;primary&quot;</span>&gt;</span>设置href跳转<span class="hljs-tag">&lt;/<span class="hljs-name">cs-button</span>&gt;</span>\n</code></pre><h2>API</h2><h3>Props</h3><table><thead><tr><th>参数</th><th>说明</th><th>类型</th><th>默认值</th></tr></thead><tbody><tr><td>type</td><td>类型，可选值为 <code>primary</code> <code>info</code> <code>warning</code> <code>danger</code> <code>success</code></td><td>String</td><td><code>default</code></td></tr><tr><td>color</td><td>按钮颜色，支持传入 <code>linear-gradient</code> 渐变色</td><td>String</td><td>-</td></tr><tr><td>disabled</td><td>是否禁用按钮</td><td>Boolean</td><td><code>false</code></td></tr><tr><td>block</td><td>是否为块级元素</td><td>Boolean</td><td><code>false</code></td></tr><tr><td>icon</td><td>按钮图标，同Icon组件name属性</td><td>String</td><td>-</td></tr><tr><td>loading</td><td>按钮loading状态</td><td>Boolean</td><td><code>false</code></td></tr><tr><td>href</td><td>设置跳转链接</td><td>String</td><td>-</td></tr></tbody></table>',28)],p={setup:(t,{expose:p})=>(p({frontmatter:{}}),(t,p)=>(a(),s("div",n,l)))};export{p as default};
